import React from 'react';


const VideoCard = ({ video, onPlay, cardHeight }) => {
  // Status color and dot
    // Status image mapping (images should be in public/ as status-<status>.png)
    const statusImageMap = {
      Active: process.env.PUBLIC_URL + '/status-active.png',
      Draft: process.env.PUBLIC_URL + '/status-draft.png',
      Pass: process.env.PUBLIC_URL + '/status-pass.png',
      Hide: process.env.PUBLIC_URL + '/status-hide.png',
      'Try Again': process.env.PUBLIC_URL + '/status-tryagain.png',
      'Not Started': '', // fallback to no image or a default if needed
    };
  const status = video.statusBtn;
  const style = statusMap[status] || { bg: '#64748b', dot: '#64748b', color: '#fff' };
  return (
    <div style={{
      background:'#fff',
      borderRadius:18,
      boxShadow:'0 2px 8px -2px #a855f722',
      padding:'1.25rem',
      display:'flex',
      flexDirection:'column',
      alignItems:'flex-start',
      minWidth:260,
      maxWidth: '100%',
      margin:'0.5rem',
      height: cardHeight === 'stretch' ? '100%' : undefined
    }}>
      <img src={video.image} alt={video.title} style={{width:'100%',height:120,objectFit:'cover',borderRadius:12,marginBottom:'1rem'}} />
      <div style={{fontWeight:700,fontSize:'1.25rem',color:'#23272e',marginBottom:'0.5rem',display:'flex',alignItems:'center',width:'100%',justifyContent:'space-between'}}>
        <span>{video.title}</span>
        <span style={{fontSize:'1.5rem',color:'#23272e',cursor:'pointer',padding:'0 0.25rem'}}>⋮</span>
      </div>
      <div style={{display:'flex',alignItems:'center',gap:'1.2rem',marginBottom:'0.25rem',fontSize:'1.05rem',color:'#23272e'}}>
        <span style={{display:'flex',alignItems:'center',gap:4}}>
          <img src={process.env.PUBLIC_URL + '/Clock.png'} alt="clock" style={{width:17,height:17,marginRight:3,verticalAlign:'middle'}} />
          <span style={{color:'#7c3aed'}}>{video.duration} น.</span>
        </span>
        <span style={{display:'flex',alignItems:'center',gap:4}}>
          <img src={process.env.PUBLIC_URL + '/FireSimple.png'} alt="fire" style={{width:17,height:17,marginRight:3,verticalAlign:'middle'}} />
          <span style={{color:'#fb923c'}}>{video.kcal} Kcal</span>
        </span>
      </div>
      <div style={{color:'#23272e',fontSize:'1.08rem',marginBottom:'0.25rem'}}>Score: <span style={{fontWeight:700}}>{video.score ?? '-'}%</span></div>
      {status && (
        <span style={{
          display: 'flex', alignItems: 'center', background: style.bg, color: style.color, fontWeight: 800, borderRadius: 16, padding: '0.35rem 1.4rem', fontSize: '1.18rem', marginBottom: '1rem', boxShadow: '0 1px 4px #a855f722', border: style.border || 'none', letterSpacing: 0.2,
          minWidth: 120, justifyContent: 'flex-start', gap: '0.85rem',
          textShadow: '0 1px 0 #0001',
        }}>
          {statusImageMap[status] ? (
            <img
              src={statusImageMap[status]}
              alt={status + ' status'}
              style={{
                width: 18,
                height: 18,
                marginRight: 8,
                objectFit: 'contain',
                display: 'inline-block',
                verticalAlign: 'middle',
              }}
            />
          ) : (
            <span
              style={{
                display: 'inline-block',
                width: 14,
                height: 14,
                borderRadius: '50%',
                background: '#BDBDBD',
                marginRight: 8,
                verticalAlign: 'middle',
              }}
            />
          )}
          <span style={{ fontWeight: 700 }}>{status}</span>
        </span>
      )}
      <button onClick={onPlay} style={{width:'100%',background:'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:12,padding:'0.7rem 0',fontSize:'1.15rem',marginTop:'0.5rem',cursor:'pointer',display:'flex',alignItems:'center',justifyContent:'center',gap:8}}>
        <svg width="22" height="22" fill="none" xmlns="http://www.w3.org/2000/svg"><circle cx="11" cy="11" r="11" fill="#fff" fillOpacity="0.18"/><path d="M9.5 8.5v5l4-2.5-4-2.5Z" fill="#fff"/></svg>
        Play
      </button>
    </div>
  );
};

export default VideoCard;
